import React, { useState } from 'react';
import './CropPrediction.css';
import wheatImage from '../../Assets/Images/wheat.jpg';

const CropPrediction = () => {
    const [formData, setFormData] = useState({
        nitrogen: '',
        phosphorus: '',
        potassium: '',
        temperature: '',
        humidity: '',
        ph: '',
        rainfall: '',
        location: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Submitted Data:', formData);

        // Simulate an API call or database update
        alert('Crop Prediction and Recommendation data submitted successfully!');
    };

    return (
        <div className="container">
            <div className="main-container">
                <div className="left-section">
                    <div className="header">
                        <div className="text">Crop Prediction & Recommendation</div>
                        <div className="underline"></div>
                    </div>
                    <form className="inputs" onSubmit={handleSubmit}>
                        <div className="form-section">
                            <div className="section-title">Soil and Weather Details</div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Nitrogen (N)"
                                    name="nitrogen"
                                    value={formData.nitrogen}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Phosphorus (P)"
                                    name="phosphorus"
                                    value={formData.phosphorus}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Potassium (K)"
                                    name="potassium"
                                    value={formData.potassium}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="pH Level"
                                    name="ph"
                                    value={formData.ph}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                        </div>
                        <div className="form-section">
                            <div className="section-title">Environmental Conditions</div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Temperature (Â°C)"
                                    name="temperature"
                                    value={formData.temperature}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Humidity (%)"
                                    name="humidity"
                                    value={formData.humidity}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Rainfall (mm)"
                                    name="rainfall"
                                    value={formData.rainfall}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                            <div className="input">
                                <input
                                    type="text"
                                    placeholder="Location"
                                    name="location"
                                    value={formData.location}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                        </div>
                        <div className="submit-container">
                            <button type="submit" className="submit">
                                Recommend Crop
                            </button>
                        </div>
                    </form>
                </div>
                <div className="right-panel">
                    <img src={wheatImage} alt="Wheat background" className="background-image" />
                </div>
            </div>
        </div>
    );
};

export default CropPrediction;
